    "2016-08-06T09:12:53.297347",nt"name": "region-9-sole-source-aquifers",nt"isopen":
    false,nt"url": null,nt"notes": "There are 7 polygons representing 6 individual
    sole source aquifer boundaries and one streamflow source area in California, Arizona,
    and Nevada. Various efforts were combined to create the final product, which represents
    the Federal Register boundary description. Sole source aquifers are jurisdictional
    areas, so their boundaries are sometimes political rather than natural. A sole source
    aquifer is an area for which the ground water has been determined to be the only
    source of drinking water. Projects which receive federal grants or loan guarantees
    that are found to be within a sole source aquifer are reviewed to assess whether
    they have the potential to contaminate the ground water. If this potential exists
    the sole source aquifer program can deny federal funding until the project is modified.",nt"license_title":
